    "2013-03-14T19:49:32.677650",nt"name": "kansas-cartographic-database-kcd",nt"isopen":
    false,nt"url": null,nt"notes": "The Kansas Cartographic Database (KCD)
    is an exact digital representation of selected features from the USGS 7.5 minute
    topographic map series. Features that are captured include: county boundaries, township
    boundaries, section corners, major transportation, railroads, and principle hydrology.
    Major transportation and principle hydrology are defined as those features that
    are found on the official USGS 1:500,000 state map. It represents the general hydrologic
    and transportation network in Kansas. More detailed hydrology (all streams and lakes)
    is available but has not been converted to Arc/Info. This can be requested through
    KGS. The data was captured using in-house software titled GIMMAP. It was imported
    into Arc/Info using the generate format and then cleaned or built. It was designed
    to be a cartographic database for use on state and county map production.",nt"license_title":
